CREATE VIEW dbo.dsi_vwEMETDENEX_Export AS 
    SELECT TOP 200000000 Data FROM dbo.U_EMETDENEX_File WITH (NOLOCK)
    ORDER BY RIGHT(RecordSet,2), InitialSort